import React from 'react';
import './DivingPage.css';

const DivingPage = () => {
  const diveStats = [
    { label: "Total Dives", value: "75+" },
    { label: "Certification", value: "PADI Divemaster" },
    { label: "Countries", value: "6" },
    { label: "Max Depth", value: "40m" }
  ];

  const diveLocations = [
    {
      country: "Maldives",
      dives: "15+",
      highlights: "Manta rays, reef sharks, crystal clear waters"
    },
    {
      country: "Thailand", 
      dives: "20+",
      highlights: "Whale sharks, coral gardens, macro photography"
    },
    {
      country: "Egypt",
      dives: "12+", 
      highlights: "WWII wrecks, dramatic drop-offs, Red Sea diversity"
    },
    {
      country: "Australia",
      dives: "8+",
      highlights: "Great Barrier Reef, potato cod, pristine ecosystems"
    },
    {
      country: "Philippines",
      dives: "10+",
      highlights: "Whale shark diving, pristine reefs, underwater caves"
    },
    {
      country: "Indonesia",
      dives: "6+",
      highlights: "Manta cleaning stations, biodiversity hotspot, drift diving"
    }
  ];

  return (
    <div className="diving-page">
      <div className="diving-content">
        <header className="diving-header">
          <h1 className="page-title">Diving</h1>
          <p className="page-subtitle">Underwater Adventures & Exploration</p>
        </header>

        <section className="intro-section">
          <p className="intro-text">
            PADI Divemaster with 75+ logged dives across 6 countries. Passionate about marine conservation 
            and underwater exploration, specializing in wreck diving and deep-water adventures.
          </p>
        </section>

        <section className="section">
          <h2 className="section-title">Diving Statistics</h2>
          <div className="stats-grid">
            {diveStats.map((stat, index) => (
              <div key={index} className="stat-item">
                <span className="stat-value">{stat.value}</span>
                <span className="stat-label">{stat.label}</span>
              </div>
            ))}
          </div>
        </section>

        <section className="section">
          <h2 className="section-title">Dive Locations</h2>
          <div className="locations-list">
            {diveLocations.map((location, index) => (
              <div key={index} className="location-item">
                <div className="location-header">
                  <h3 className="location-country">{location.country}</h3>
                  <span className="location-dives">{location.dives} dives</span>
                </div>
                <p className="location-highlights">{location.highlights}</p>
              </div>
            ))}
          </div>
        </section>

        <footer className="diving-footer">
          <p className="footer-quote">
            "The sea, once it casts its spell, holds one in its net of wonder forever." - Jacques Cousteau
          </p>
        </footer>
      </div>
    </div>
  );
};

export default DivingPage;
